import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    BrowserRouter
  } from "react-router-dom";
import Home from "../Pages/Home/Home"
function Routes() {
  return (
    <BrowserRouter>
    <Routes>
            <Route path='/'> <Home/> </Route>
    </Routes>
    </BrowserRouter>
  )
}

export default Routes
